import React, { useState } from "react";
import "../../styles/NewspaperLayout.css"; // Ensure the CSS file path is correct

const NewspaperLayout = () => {
  // State to track selected ad and its price
  const [selectedAd, setSelectedAd] = useState(null);
  const [selectedPrice, setSelectedPrice] = useState(null);

  // Price Mapping for Ad Sizes
  const adPrices = {
    large: 5000,
    medium: 3000,
    small: 1500,
  };

  // Function to handle ad click and show price
  const handleAdClick = (size, index) => {
    setSelectedAd(index);
    setSelectedPrice(adPrices[size]);
  };

  return (
    <div className="newspaper-container">
      <div className="newspaper-content">
        {/* Newspaper Title */}
        <h1 className="newspaper-title">THE VIRTUAL TIMES</h1>
        <p className="sub-title">Your Daily Source of News</p>

        {/* News Headline Section */}
        <div className="news-buttons">
          <button>"Give Tamils Autonomy"</button>
          <button>Ship Crew Questions</button>
          <button>Uruguay in Quarterfinals</button>
        </div>

        <div className="news-headline">
          <h2>Pakistan’s FIA to Collaborate with CBI on Fighting Terror</h2>
          <p>Outcomes about decisive war on crime and global track collaborations...</p>
        </div>

        {/* Advertisement Spaces */}
        <div className="ads-container">
          {/* Large Ad */}
          <div
            className="ad-space large"
            onClick={() => handleAdClick("large", 0)}
          >
            Large Advertisement Space (Click to Book)
            {selectedAd === 0 && <p className="ad-price">Price: ₹{selectedPrice}</p>}
          </div>

          <div className="ad-row">
            {/* Medium Ad */}
            <div
              className="ad-space medium"
              onClick={() => handleAdClick("medium", 1)}
            >
              Medium Advertisement Space (Click to Book)
              {selectedAd === 1 && <p className="ad-price">Price: ₹{selectedPrice}</p>}
            </div>

            {/* Small Ad */}
            <div
              className="ad-space small"
              onClick={() => handleAdClick("small", 2)}
            >
              Small Advertisement Space (Click to Book)
              {selectedAd === 2 && <p className="ad-price">Price: ₹{selectedPrice}</p>}
            </div>
          </div>

          <div className="ad-row">
            {/* Small Ad */}
            <div
              className="ad-space small"
              onClick={() => handleAdClick("small", 3)}
            >
              Small Advertisement Space (Click to Book)
              {selectedAd === 3 && <p className="ad-price">Price: ₹{selectedPrice}</p>}
            </div>

            {/* Medium Ad */}
            <div
              className="ad-space medium"
              onClick={() => handleAdClick("medium", 4)}
            >
              Medium Advertisement Space (Click to Book)
              {selectedAd === 4 && <p className="ad-price">Price: ₹{selectedPrice}</p>}
            </div>
          </div>

          {/* Large Ad */}
          <div
            className="ad-space large"
            onClick={() => handleAdClick("large", 5)}
          >
            Large Advertisement Space (Click to Book)
            {selectedAd === 5 && <p className="ad-price">Price: ₹{selectedPrice}</p>}
          </div>

          <div className="ad-row">
            {/* Medium Ad */}
            <div
              className="ad-space medium"
              onClick={() => handleAdClick("medium", 6)}
            >
              Medium Advertisement Space (Click to Book)
              {selectedAd === 6 && <p className="ad-price">Price: ₹{selectedPrice}</p>}
            </div>

            {/* Large Ad */}
            <div
              className="ad-space large"
              onClick={() => handleAdClick("large", 7)}
            >
              Large Advertisement Space (Click to Book)
              {selectedAd === 7 && <p className="ad-price">Price: ₹{selectedPrice}</p>}
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default NewspaperLayout;
